# [46] 305    Number of Islands II
# 
# Given a n,m which means the row and column of the 2D matrix and an array of pair A( size k). Originally, the 2D matrix is all 0 which means there is only sea in the matrix. The list pair has k operator and each operator has two integer A[i].x, A[i].y means that you can change the grid matrix[A[i].x][A[i].y] from sea to island. Return how many island are there in the matrix after each operator.
# 
# Example
# Given n = 3, m = 3, array of pair A = [(0,0),(0,1),(2,2),(2,1)].
# 
# return [1,1,2,2].
# Note 0 is represented as the sea, 1 is represented as the island. If two 1 is adjacent, we consider them in the same island. We only consider up/down/left/right adjacent.

        
# 2017.05.27
# Union find
class Solution(object):
    def numIslands2(self, m, n, positions):
        """
        :type m: int
        :type n: int
        :type positions: List[List[int]]
        :rtype: List[int]
        """
        roots = [ x for x in xrange(m * n)]
        pairs = [[0, 1], [0, -1], [1, 0], [-1, 0]]
        res = []
        dic = set()
        
        count = 0
        for index in xrange(len(positions)):
            i, j = positions[index]
            dic.add(i * n + j)      # Optimize, add visited node into a set
            count += 1
            x = self.find(roots, i * n + j)
            for pair in pairs:
                ii, jj = i + pair[0], j + pair[1]
                if ii < m and ii >= 0 and jj < n and jj >= 0 and ii * n + jj in dic:
                    y = self.find(roots, ii * n + jj)
                    if x != y:  # Union them
                        roots[y] = x    # not roots[x] = y. it will be keep overwritten.
                        count -= 1
            res.append(count)
        return res
    
    def find(self, roots, id):
        while roots[id] != id:
            roots[id] = roots[roots[id]]
            id = roots[id]
        return id
        


if __name__ == "__main__":
    m = 3
    n = 3
    A = [ [0,0], [0,1], [2,2], [2,1] ]
    Solution().numberIsland(m, n, A)

